import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import { Button } from "reactstrap";
import {getMyStadiums} from'../redux/actions/stadiumAction'

const MyStadiums = () => {
  useEffect(()=>{
    getMyStadiums()
  },[])
  return (
    <div>
      <h1>My Stadiums</h1>
      <Link to="/stadiumform">
        <Button color="success">Add a stadium</Button>
      </Link>
    </div>
  );
};

export default connect(mapStateToProps,{getMyStadiums})(MyStadiums);
